import React from 'react';
import './Dashboard.css';


const TrainerHeader = ({ user, date }) => {
  const handleSignOut = () => {
    if (window.confirm('คุณต้องการออกจากระบบใช่หรือไม่?')) {
      localStorage.removeItem('token');
      localStorage.removeItem('user');
      window.location.href = '/';
    }
  };
  return (
    <header className="trainee-header">
      <div className="trainee-header__logo">FitAddict</div>
      <div className="trainee-header__user">
        <div className="trainee-header__info">
          <div className="trainee-header__name">Hi {user?.name || ''}</div>
          <div className="trainee-header__date">{date}</div>
        </div>
        <img className="trainee-header__avatar" src={user?.picture || `/user (1).png`} alt="avatar" />
        <button className="trainee-header__logout" onClick={handleSignOut}>
          ออกจากระบบ
        </button>
      </div>
    </header>
  );
};

export default TrainerHeader;
